import React, { Component } from 'react';

class ImagePage extends Component {

  handleOnClick() {
    debugger
    this.props.store.dispatch({
      type: 'REMOVE_IMAGE',
      id: this.props.id,
    });
  }

  render() {
    return (
      <li>
        {this.props.image_url}
        <button onClick={() => this.handleOnClick()}>Remove Image</button>
      </li>
    );
  }
};

export default ImagePage
